  }
  render(){
    console.log(this.props)
    return <div>StreamEdit</div>;
  }
}
 const mapStateToProps = (state,ownProps) => {
   return {
     stream:state.streams[ownProps.match.params.id]
   }
 }
export default connect(mapStateToProps,{fetchStream})(StreamEdit);
